import {
    makeStyles
} from "@material-ui/core/styles";

import WebFont from "webfontloader";

WebFont.load({
    google: {
        families: ["Dancing Script:300,400,700", "cursive"],
    },
});

const useStyles = makeStyles((theme) => ({
    root: {
        position: "fixed",
        fontFamily: "Dancing Script",
    },
    container: {
        width: "100%"
    },
    welcome: {
        textAlign: "center",
        lineHeight: "350px",

        fontSize: "65px"
    },
    desc: {

    }
}));

export default useStyles;
